        $(selectors.searchResult).waitForDisplayed();
        let searchLength = $$(selectors.searchResult).length;
        assert.isTrue(searchLength > min);

    }

    openLink() {
        const testLink = $(selectors.sabreCutsLink);
        testLink.click();
    }

}

export default new SearchResult;

